INSERT INTO `portfolio` VALUES (3, '2021-04-30 10:19:33', '2021-05-01 09:46:22', NULL, 'Web', 'Test Portfolio', 0, 'Online Trade is your No 1 solution for creating', '<p style=\"margin: 0px 0px 24px; padding: 8px 0px 0px; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 400; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Poppins, Helvetica, Arial, sans-serif; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: rgb(73, 73, 73); letter-spacing: 0.3px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Online Trade is your No 1 solution for creating an investment platform. Forex, stock and cryptocurrency investment and monitoring now simplified. Online Trade makes it easy for you to run your own online investment system within minutes. It is a full responsive &amp; dynamic investment Platform built with Laravel Framework. It’s now easy to get started with your own Investment system.</p><h3 id=\"item-description__key-features\" style=\"margin: 0px 0px 14.4px; padding: 20.8px 0px 0px; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 700; font-stretch: inherit; font-size: 24px; line-height: 1.5; font-family: Roboto, Helvetica, Arial, sans-serif; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: rgb(34, 34, 34); letter-spacing: 0.3px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Key features</h3><ul style=\"margin: 0px 0px 24px 25px; padding: 0px; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 400; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Poppins, Helvetica, Arial, sans-serif; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; list-style: inside disc; position: relative; color: rgb(73, 73, 73); letter-spacing: 0.3px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><li style=\"margin: 0px; padding: 0px 0px 8px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; list-style-type: disc; list-style-position: inside; position: relative;\">Supports Litecoin, Bitcoin and Ethereum</li></ul>', 'mm-oo', 1);
